import React from 'react';
import './filters.css';

const filters = props => {
  return (
      <div className="Filters">
        <ul class="DatesFiltersList"></ul>
        <ul class="TypeFiltersList"></ul>
        <ul class="CategoryTagList"></ul>
        <ul class="StatusList">
          <li>1</li>
          <li>2</li>
          <li>3</li>
          <li>4</li>
          <li>5</li>
          <li>6</li>
          <li>7</li>
        </ul>
      </div>
  )
}

export default filters;
